import React from 'react'
import Typography from '@material-ui/core/Typography'

interface Props{
    data : {
        title?: string,
        teacher?: string,
        deadline?: string,
        scienceArea?: string,
        description?: string,
        reportFile?: string,
        presentationFile?: string,
        consultantReportFile?: string,
        link?: string,
    }
}

function Description(props : Props){
    return(
        <div>
            <Typography variant='h4'>{props.data.description}</Typography>

        </div>
    )
}

export default Description
